import{_ as l,c as i,o as a,d as s}from"./app.6940013b.js";const e="/MyBlog/assets/004B1E1A.f1ae2280.png",r="/MyBlog/assets/Raspberry.0b3e8b03.png",C=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"随笔日记记录","slug":"随笔日记记录","link":"#随笔日记记录","children":[]},{"level":2,"title":"2023年11月11日   星期六","slug":"_2023年11月11日-星期六","link":"#_2023年11月11日-星期六","children":[{"level":3,"title":"Devops 的概念和理解","slug":"devops-的概念和理解","link":"#devops-的概念和理解","children":[]},{"level":3,"title":"IPD产品开发","slug":"ipd产品开发","link":"#ipd产品开发","children":[]}]},{"level":2,"title":"自动化运维和DEvops 的理解","slug":"自动化运维和devops-的理解","link":"#自动化运维和devops-的理解","children":[]},{"level":2,"title":"2023年11月13日   星期一","slug":"_2023年11月13日-星期一","link":"#_2023年11月13日-星期一","children":[{"level":3,"title":"Deeplearning 深度学习","slug":"deeplearning-深度学习","link":"#deeplearning-深度学习","children":[]},{"level":3,"title":"机器学习（内容）","slug":"机器学习-内容","link":"#机器学习-内容","children":[]},{"level":3,"title":"(技术文章)","slug":"技术文章","link":"#技术文章","children":[]}]},{"level":2,"title":"2023年11月15日   星期三","slug":"_2023年11月15日-星期三","link":"#_2023年11月15日-星期三","children":[]},{"level":2,"title":"2023年11月16日   星期四","slug":"_2023年11月16日-星期四","link":"#_2023年11月16日-星期四","children":[{"level":3,"title":"Redis 的内容","slug":"redis-的内容","link":"#redis-的内容","children":[]}]},{"level":2,"title":"2023年11月16日   星期四","slug":"_2023年11月16日-星期四-1","link":"#_2023年11月16日-星期四-1","children":[]},{"level":2,"title":"2023年11月18日  星期六","slug":"_2023年11月18日-星期六","link":"#_2023年11月18日-星期六","children":[{"level":3,"title":"常用的嵌入式开发平台有以下几种：","slug":"常用的嵌入式开发平台有以下几种","link":"#常用的嵌入式开发平台有以下几种","children":[]},{"level":3,"title":"I2C总线详解","slug":"i2c总线详解","link":"#i2c总线详解","children":[]},{"level":3,"title":"Raspberry pi","slug":"raspberry-pi","link":"#raspberry-pi","children":[]}]}],"relativePath":"workrecord/diary/index.md"}'),n={name:"workrecord/diary/index.md"},p=s(`<h2 id="随笔日记记录" tabindex="-1">随笔日记记录 <a class="header-anchor" href="#随笔日记记录" aria-hidden="true">#</a></h2><blockquote><p>根据时间内容随时记录看到和学习到的一些知识和内容</p></blockquote><h2 id="_2023年11月11日-星期六" tabindex="-1">2023年11月11日 星期六 <a class="header-anchor" href="#_2023年11月11日-星期六" aria-hidden="true">#</a></h2><h3 id="devops-的概念和理解" tabindex="-1">Devops 的概念和理解 <a class="header-anchor" href="#devops-的概念和理解" aria-hidden="true">#</a></h3><p>DevOps是一种软件开发和IT运维的实践方法，旨在通过加强开发团队与运维团队之间的协作与沟通，实现软件应用的快速交付、高质量和可靠性。 DevOps包含以下几个主要方面：</p><ol><li><p>自动化：自动化是DevOps的核心原则之一。它涉及使用工具和脚本来自动执行软件开发和部署过程，从而提高效率、降低错误和减少重复工作。</p></li><li><p>持续集成和持续交付（CI/CD）：CI/CD是DevOps的关键实践，旨在将代码频繁集成到共享存储库中，并自动构建、测试和部署软件。这样可以快速检测和解决问题，缩短交付时间，并提高产品质量。</p></li><li><p>配置管理：配置管理涉及对软件环境进行版本控制和自动化管理。通过使用工具如Ansible、Chef或Puppet，可以确保各个环境的一致性，并能够快速复制和部署环境。</p></li><li><p>容器化和容器编排：容器化技术（如Docker）使得应用程序更易于部署、管理和扩展。容器编排工具（如Kubernetes）帮助管理大规模容器化应用程序的自动化部署和管理。</p></li><li><p>监控和日志管理：DevOps需要建立有效的监控和日志管理系统，以便实时跟踪应用程序的性能、健康状况和异常情况。这些信息对于快速定位和解决问题至关重要。</p></li></ol><h3 id="ipd产品开发" tabindex="-1">IPD产品开发 <a class="header-anchor" href="#ipd产品开发" aria-hidden="true">#</a></h3><p>IPD指的是&quot;产品开发流程&quot;（或&quot;产品开发过程&quot;）, 是指将一个新产品从概念到实际推向市场的整个过程。它涉及到研究、设计、制造、测试和推广等一系列步骤 IPD的全称是“Integrated Project Delivery”，即集成产品开发</p><ol><li><p>开源软件：</p><p>Odoo（原名OpenERP）：它是一个全功能的企业资源规划（ERP）软件。Odoo提供了各种模块，包括项目管理、任务管理、采购管理等，可以用来支持企业的IPD流程。</p><p>Redmine：这是一个灵活且易于使用的项目管理工具。它提供了任务跟踪、问题追踪、版本控制等功能，适合用于IPD流程中的项目管理。</p><p>Tuleap：它是一个开源的协作平台，专注于软件开发和项目管理。Tuleap提供了项目追踪、需求管理、文档管理等功能，非常适合IPD流程的实施。</p></li><li><p>商业软件系统：</p><p>Microsoft Project：这是一款功能强大的项目管理软件，广泛应用于企业IPD流程。它提供了进度计划、资源分配、成本管理等功能，并具有良好的可视化和报告功能。</p><p>Oracle Primavera：这是一套专业的项目和端到端解决方案，适用于复杂的工程和建筑项目。它提供了项目规划、风险管理、资源管理等功能，非常适合大型企业的IPD流程。</p><p>Jira：这是一款广泛使用的敏捷项目管理工具，适用于软件开发和IT团队。Jira提供了任务追踪、缺陷管理、故事板等功能，可以支持敏捷IPD流程的实施。</p></li></ol><h2 id="自动化运维和devops-的理解" tabindex="-1">自动化运维和DEvops 的理解 <a class="header-anchor" href="#自动化运维和devops-的理解" aria-hidden="true">#</a></h2><p>目的是加强Dev 和OPS 之间的沟通和协助，部署和运维全程自动化进行</p><ul><li><p>Kubernnetes 的认识和实际使用 k8s 是开源的容器编排平台。主要用于自动化应用程序的部署和管理。主要组件有 Master 节点和worker 节点 Master节点负责资源调度和管理，</p></li><li><p>300多台服务器，如何进行管理 ？ 堡垒机，ansible</p></li><li><p>LVS nginx,Haproxy 有啥区别 LVs ： 是基于四层转发的 （linux virtual server) HAProxy ： 是基于四层和七层转发的。专业的代理服务器 Ngixn： 是web和缓存服务器，可以做七层的转发</p></li></ul><h2 id="_2023年11月13日-星期一" tabindex="-1">2023年11月13日 星期一 <a class="header-anchor" href="#_2023年11月13日-星期一" aria-hidden="true">#</a></h2><h3 id="deeplearning-深度学习" tabindex="-1">Deeplearning 深度学习 <a class="header-anchor" href="#deeplearning-深度学习" aria-hidden="true">#</a></h3><h3 id="机器学习-内容" tabindex="-1"><strong>机器学习（内容）</strong> <a class="header-anchor" href="#机器学习-内容" aria-hidden="true">#</a></h3><blockquote><p>机器学习是一种人工智能的领域，其目的是通过让计算机系统从数据中学习和改进，以实现特定任务的自动化。与传统的编程方式不同，机器学 习模型可以从大量的数据中提取模式和规律，并使用这些模式进行预测、决策或执行特定任务。</p></blockquote><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">机器之所以可以自我学习，是因为机器学习模型具备了学习能力的算法和结构。</span></span>
<span class="line"><span style="color:#A6ACCD;">这些模型可以根据输入的数据进行自我调整和改进，以提高其在特定任务上的性能。</span></span>
<span class="line"><span style="color:#A6ACCD;">通过不断地暴露给模型更多的数据和反馈，它可以逐步优化自己的表现，并提供更准确的输出结果。</span></span>
<span class="line"><span style="color:#A6ACCD;">这种自我学习的能力使得机器能够处理复杂的问题，并且在面对新的情况时具备适应性和智能化的能力</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="技术文章" tabindex="-1"><strong>(技术文章)</strong> <a class="header-anchor" href="#技术文章" aria-hidden="true">#</a></h3><p>来自微信公众号 民工哥技术之路<br> 文章名字 还是决定去华为了 重要内容摘要</p><ul><li>入职薪酬</li><li>长期预期薪酬</li><li>offer 在同龄人中的相对档次</li><li>业务匹配度</li><li>成长空间</li><li>工业界的影响力</li><li>学术界的影响力</li><li>Work-life balance</li><li>领导熟悉度</li><li>工作稳定程度</li><li>公司文化</li><li>公司品牌</li><li>部门前景</li><li>技术积累</li><li>大牛老板</li></ul><h2 id="_2023年11月15日-星期三" tabindex="-1">2023年11月15日 星期三 <a class="header-anchor" href="#_2023年11月15日-星期三" aria-hidden="true">#</a></h2><p><strong>Mysql基本的问题</strong></p><ol><li>char varchar 的区别？</li></ol><p>对于经常需要变化的数据来说，CHAR 比 varchar 更好，</p><ol start="2"><li><p>TRUNCAT 和 delete 的区别 Delect 是从表中删除指定的一行 Trucat 是永久性的删除某一行</p></li><li><p>触发器是啥？ 都有啥</p></li><li><p>Float 和double 的区别是啥</p></li><li></li></ol><h2 id="_2023年11月16日-星期四" tabindex="-1">2023年11月16日 星期四 <img src="`+e+'" alt="Alt text"> <a class="header-anchor" href="#_2023年11月16日-星期四" aria-hidden="true">#</a></h2><h3 id="redis-的内容" tabindex="-1">Redis 的内容 <a class="header-anchor" href="#redis-的内容" aria-hidden="true">#</a></h3><h2 id="_2023年11月16日-星期四-1" tabindex="-1">2023年11月16日 星期四 <img src="'+e+`" alt="Alt text"> <a class="header-anchor" href="#_2023年11月16日-星期四-1" aria-hidden="true">#</a></h2><p>ETL (SSIS,kETTLE) Extract Transform Load<br> 提取，转换，加载 ETL 的主要目标是将异构的数据源整合为一致的，可分析的数据集，支持业务决策，报表生成，数据分析等</p><h2 id="_2023年11月18日-星期六" tabindex="-1">2023年11月18日 星期六 <a class="header-anchor" href="#_2023年11月18日-星期六" aria-hidden="true">#</a></h2><h3 id="常用的嵌入式开发平台有以下几种" tabindex="-1">常用的嵌入式开发平台有以下几种： <a class="header-anchor" href="#常用的嵌入式开发平台有以下几种" aria-hidden="true">#</a></h3><pre><code>Arduino：Arduino是一种简单易用的开源电子原型平台，适用于初学者和专业人士。它提供了一个方便的开发环境和丰富的库函数，支持多种硬件扩展板，如传感器、执行器等。

Raspberry Pi：Raspberry Pi是一款小型的低成本计算机板，具有强大的处理能力和丰富的接口。它可以运行Linux操作系统，并支持多种编程语言，如Python、C/C++等。

STM32：STM32(意法半导体）系列是STMicroelectronics推出的一款基于ARM Cortex-M内核的32位微控制器。它具有高性能、低功耗、丰富的外设和广泛的开发工具支持，适用于各种嵌入式应用领域。

ESP8266/ESP32：ESP8266和ESP32是乐鑫科技推出的一款集成Wi-Fi功能的芯片，可用于构建物联网设备。它们具有小巧的体积、低功耗和丰富的通信接口，适合于无线通信和物联网项目的开发。

BeagleBone：BeagleBone是一款基于ARM架构的开发板，具有丰富的接口和强大的处理能力。它支持多种操作系统，如Linux和Android，适合于构建复杂的嵌入式系统。
</code></pre><p>ESP8266/ESP32 是基于tensilica 处理器架构</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">Arduino官方网站：提供了丰富的实验指南、示例代码和教程，适合初学者入门。</span></span>
<span class="line"><span style="color:#A6ACCD;">[Raspberry Pi官方网站](https://www.raspb)</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><p>乐鑫科技 的开发板是国内做的，</p><p>MCU代表微控制器单元（Microcontroller Unit），是一种集成了中央处理器（CPU）、内存和输入/输出接口等功能的小型计算机系统<br> 串口通信和I2C/SPI总线是常用的数据通信协议</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>串口通信：使用通信端口（例如RS-232）来发送和接收数据。发送方将数据转换为电平信号，并通过物理线连接到接收方。接收方解析电平信号并还原数据。</p><p>I2C总线：使用两根线（SDA和SCL）进行串行传输。发送方将数据放置在SDA线上，并通过SCL线发送时钟信号。接收方在特定时钟边沿读取数据。</p><p>SPI总线：使用多个线（主时钟线、主片选线、MISO、MOSI）进行全双工传输</p></div><p>单片机就是 MCU</p><h3 id="i2c总线详解" tabindex="-1">I2C总线详解 <a class="header-anchor" href="#i2c总线详解" aria-hidden="true">#</a></h3><blockquote><p>I2C总线是一种常用的通信接口 I2C总线是由Philips公司开发的一种简单、双向二线制同步串行总线。它只需要两根线即可在连接于总线上的器件之间传送信息</p></blockquote><p>I2C具有如下特点：</p><p>①只需要两条总线；串行数据线(SDA)和串行时钟线(SCL)。</p><p>②连接到总线的每个设备都是可通过唯一地址进行软件寻址的，并且始终存在简单的控制器/目标关系；控制器可以作为控制器发送器或控制器接收器运行。</p><p>③这是一种真正的多控制器总线，包括冲突检测和仲裁，以防止两个或更多控制器同时启动数据传输时出现数据损坏。</p><p>④面向8位的串行双向数据传输速率在标准模式下最高可达100 kbit/s，在快速模式下最高可达400 kbit/s，在快速增强模式下最高可达1 Mbit/s，在高速模式下最高可达3.4 Mbit/s。</p><p>⑤串行、面向8位、单向数据传输，在超快速模式下最高可达5 Mbit/s。</p><p>⑥片内滤波可抑制总线数据线上的尖峰信号，以保持数据完整性。</p><p>⑦可以连接到同一总线的IC数量仅受最大总线电容的限制。在某些条件下（如简化SCL时钟频率、增加输出驱动力、增加缓冲器件、改进上拉电阻等），可以允许更大的电容。</p><p>⑧极低的电流消耗，高抗扰度，宽电源电压范围，宽工作温度范围。</p><p>⑨硬件的最简化，给芯片设计师减轻了节省输出引脚的压力，给芯片应用商带来了成本降低、空间减小、测试方便、易于升级等诸多好处，为芯片应用工程师的产品开发带来灵活多样的选择方案、方便快捷的调试手段、开发周期的缩短、开发效率的提高等好处。</p><h3 id="raspberry-pi" tabindex="-1">Raspberry pi <a class="header-anchor" href="#raspberry-pi" aria-hidden="true">#</a></h3><p><img src="`+r+'" alt="Alt text"></p>',52),t=[p];function d(o,c,h,u,b,_){return a(),i("div",null,t)}const v=l(n,[["render",d]]);export{C as __pageData,v as default};
